INSERT INTO `guyuan_article` VALUES ('7', '4', '三星电子宣布将在中国发布15款3G手机', '<p>全球领先的电子产品及第二大移动通信终端制造商三星电子今天在北京宣布，为全面支持中国开展3G移动通信业务，将在3G服务正式商用之际，向中国市场推出 15款3G手机。这些产品分别支持中国三大无线运营商的各种3G服务，并已经得到运营商的合作认可。凭借在电子和通信领域的整体技术实力和对消费者的准确 把握，三星电子已经开始全面发力中国的3G移动通信市场。<br />\n<br />\n&nbsp;&nbsp;&nbsp;&nbsp;2009年1月，中国政府宣布正式启动3G移动通信服务。并根据中国的实际情况，决定由三大运营商分别采用全部三种3G网络制式，&nbsp;即以中国自主知识产权为核心的TD-SCDMA，以欧洲为主要市场的WCDMA和源自北美的CDMA2000技术。<br />\n<br />\n&nbsp;&nbsp;&nbsp;&nbsp;多 年来，三星电子秉承&ldquo;做中国人民喜爱的企业，贡献于中国社会的企业&rdquo;的企业理念，准确地把握了中国社会的发展和市场的需求，推出了一系列深受中国消费者喜 爱的电子产品。为了配合中国推进具有自主知识产权的3G移动通信标准TD-SCDMA，&nbsp;三星电子从2000年开始在中国设立了通信技术研究院，&nbsp;开始进 行TD-SCDMA技术的研究。作为最早承诺支持中国3G标准的手机制造企业，三星电子已经先后投入了上亿元的研究费用，&nbsp;组建了几百人的研发团队。推出 的TD-SCDMA制式的产品，不仅通过了各级权威部门的试验和检测，也经历了2008年北京奥运会的现场考验。此次为中国移动定制的TD-SCDMA手 机，包括了满足高端商务需求的双待产品B7702C，以及数字电视手机、多媒体手机和时尚手机。<br />\n<br />\n&nbsp;&nbsp;&nbsp;&nbsp;作为世界第二大手机制造企业，三 星电子已经在全球3G市场积累了多年的技术和市场经验。最新的统计表明，在完全采用WCDMA标准的欧洲，三星电子的市场份额已经排名第二。在为中国联通 准备的产品中，不仅包括能够支持HSDPA的高端多媒体手机S7520U，也涵盖了能够支持高速上网、在线电影、在线音乐等适合不同消费需求的各种产品。<br />\n<br />\n&nbsp;&nbsp;&nbsp;&nbsp;而 在主要采用CDMA2000技术的北美市场，三星电子也取得了市场份额的第一名。即将陆续上市的支持中国电信3G服务的EVDO产品，有高端商务手机 W709。该机能够支持EVDO/GSM的双网双待功能，含800万像素拍摄系统。其他产品还包括音乐手机M609，双模手机W239，以及时尚设计的 F539等。<br />\n<br />\n&nbsp;&nbsp;&nbsp;&nbsp;作为世界上少数能够提供支持三种3G标准的终端厂商，三星电子正利用其在通信、半导体、显示器以及数字多媒体等方面 的优势，加快产品数字融合的进程。除上述3G手机产品外，三星电子也于近期推出了用于3G网络的上网卡和网络笔记本电脑。三星电子专务、无线事业部大中华 区高级副总裁卢基学先生说，&ldquo;上述15款新品，&nbsp;只是我们二季度新产品的一部分。随着中国3G移动通信市场的不断扩大，三星还将推出更多适合中国市场的终 端产品，以满足消费者对于通信和数字产品的不同需求。三星也将积极配合运营商业务的发展计划，加快技术和应用的研发。中国3G的移动通信市场前景将是非常 明亮的。&rdquo;</p>', '', '', '', '0', '1', '1241426864', '', '0', 'http://', null);
INSERT INTO `guyuan_article` VALUES ('8', '4', '诺基亚牵手移动 5款热门TD手机机型推荐', '<table width=\"100%\" cellspacing=\"0\" cellpadding=\"4\" align=\"center\" class=\"tableborder\">\r\n<tbody>\r\n<tr>\r\n<td width=\"180\" valign=\"top\" class=\"altbg4\">&nbsp;</td>\r\n<td height=\"100%\" valign=\"top\" class=\"altbg3\">\r\n<table cellspacing=\"0\" cellpadding=\"0\" border=\"0\" style=\"padding: 5px; table-layout: fixed; width: 973px; height: 2195px;\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\">\r\n<div class=\"bbs_content clearfix\">随着5月17日电信日的来临，自从09年初网民对于3G方面关注越来越多，目前国内3G网络主要有中国移动TD-SCDMA，中国联通WCDMA以及 中国电信的CDMA2000这三种制式。到底是哪一种网络制式能让消费者满意，相信好多消费者都难以判断。<br />\r\n<br />\r\n而作为3G网络最主要的组 成部分-手持终端（手机） ，相信也是好多消费者关注的焦点。目前，中国移动TD-SCDMA手机机型频频爆出，其中不乏亮点产品，像联想联想 Ophone、诺基亚、多普达 Magic等，下面就让笔者与大家一起来了解TD-SCDMA网络制式下的几款强势机型吧。<br />\r\n<br />\r\n诺基亚TD-SCDMA手机　型号：待定　参考报价：尚未上市<br />\r\n<br />\r\n随着国内3G网络发展速度加快及众多手机厂商纷纷跟进，诺基亚终于推出TD-SCDMA手机，这款诺基亚的首台TD-SCDMA测试手机型号目前仍无法 得知，但从键盘及菜单设计来看，我们可以是知道其并没有采用S60操作系统，只是配备了S40系统，机身直板造型与早期热卖的6300有几分相像。<br />\r\n<br />\r\n<p><img width=\"450\" alt=\"\" src=\"http://dstatic.esqimg.com/4812278/1.jpg\" style=\"display: block;\" /></p>\r\n<br />\r\n<br />\r\n图为：诺基亚TD-SCDMA手机<br />\r\n<br />\r\n虽然没有更多的参数资料，但是从曝光的图片我们可以知道这款诺基亚TD-SCDMA手机必定配备了QVGA分辨率的屏幕以及320万像素的摄像头，而标准的MP3以及蓝牙等功能自然不会缺少，在功能方面不会比以往的S40手机逊色。<br />\r\n<br />\r\n<p><img width=\"450\" alt=\"\" src=\"http://dstatic.esqimg.com/4812279/2.jpg\" style=\"display: block;\" /></p>\r\n<br />\r\n<br />\r\n图为：诺基亚TD-SCDMA手机<br />\r\n<br />\r\n这款诺基亚的TD手机最大的卖点便是提供了对TD-HSDPA技术的支持，最大的功能特色便是该技术被看为是TD网络下一步的演进技术，能够同时适用于 WCDMA和TD-SCDMA两种不同的网络支持，能够很好的支持非对称的数据业务，也就是说这款诺基亚手机的用户即便在全球漫游都能够使用到3G网络。 而其机身前置的摄像头也更是证实了其3G手机的身份。<br />\r\n<br />\r\n<p><img width=\"450\" alt=\"\" src=\"http://dstatic.esqimg.com/4812280/3.jpg\" style=\"display: block;\" /></p>\r\n<p><br />\r\n<br />\r\n图为：诺基亚TD-SCDMA手机<br />\r\n<br />\r\n从目前曝光的测试情况来看，通过这款诺基亚TD手机连接网络，其下载速度能够稳定在1.3Mbps左右，不过根据国内有些媒体的报道，诺基亚官方已经证实将于今天下半年配合运营商中国移动对出自己的第一款TD-SCDMA制式的S60手机，大家要拭目以待了。</p>\r\n<p>&nbsp;</p>\r\n图为：诺基亚TD-SCDMA手机<br />\r\n<br />\r\n最后较为耐人寻味的便是目前有业内人士指出目前曝光的的诺基亚TD手机其实是去年夏季就出现过的 TD测试手机，但是随着诺基亚拥有部分股份的TD芯片厂商&ldquo;凯明&rdquo;的倒闭，这款机型也就被取消了。尽管对于目前这款诺基亚的TD测试手机的身份尚无官方的 消息，但是诺基亚将推出TD手机遗失毫无悬念的事情了，相信大家也希望在TD制式下能够有更多的手机可以选择。</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>', '', '', '', '0', '1', '1241427051', '', '0', 'http://', null);
INSERT INTO `guyuan_article` VALUES ('9', '5', '售后流程', '<p>&nbsp;<strong style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 21px;\">退换货总则：</strong></p>\r\n<p style=\"margin: 0px; padding: 5px 0px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\">普通商品自您签收商品之日起30日内（鞋类、运动户外类商品15日内），VJIA可为您提供退换货服务；特殊商品办理退换货的时限，请以退换货细则中的规定为准。</p>\r\n<p style=\"margin: 0px; padding: 5px 0px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\">关于客户实际收货日期的判定规则 ：</p>\r\n<p style=\"margin: 0px; padding: 5px 0px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\">（1）VJIA网站配送发货：以客户实际签收日期为准；</p>\r\n<p style=\"margin: 0px; padding: 5px 0px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\">（2）商家配送发货：按照商家自用的第三方物流平台显示的实际到货日期为准。如合作商家未能及时、有效反馈签收日期，则VJIA客服依据寄送地址等订单信息，综合考虑配送距离等相关因素与客户人工确认实际到货日期。</p>\r\n<p style=\"margin: 0px; padding: 5px 0px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\">以下情况不予办理退换货：</p>\r\n<p style=\"margin: 0px; padding: 5px 0px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\">（1）任何非由本公司出售的商品，不予办理退换货；</p>\r\n<p style=\"margin: 0px; padding: 5px 0px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\">（2）任何已使用商品，不予办理退换货，但有质量问题除外；</p>\r\n<p style=\"margin: 0px; padding: 5px 0px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\">（3）密封产品原包装打开（如一次性封贴或者胶条封箱被拆开）；</p>\r\n<p style=\"margin: 0px; padding: 5px 0px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\">（4）任何因非正常使用及保管导致出现质量问题的商品，不予办理退换货；</p>\r\n<p style=\"margin: 0px; padding: 5px 0px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\">（5）以到付、平邮、挂号信方式退回商品，不予办理退换货；</p>\r\n<p style=\"margin: 0px; padding: 5px 0px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\">（6）退换货商品未寄到指定的收退地址，不予办理退换货。</p>\r\n<p style=\"margin: 0px; padding: 5px 0px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\">&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 5px 0px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\"><strong>客服电话：4008-901-888（8:00--21:00），未开通400地区请拨打010-57710988</strong><br />\r\n<strong>E-Mail：<a href=\"mailto:service@vjia.com\" style=\"margin: 0px; padding: 0px; outline: none; color: rgb(51, 102, 204);\">service@vjia.com</a></strong></p>\r\n<p style=\"margin: 0px; padding: 5px 0px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\">&nbsp;</p>\r\n<p class=\"b\" style=\"margin: 15px 0px 5px; padding: 3px 8px; line-height: 21px; background-color: rgb(238, 238, 238); overflow: hidden; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\"><span style=\"color: rgb(211, 23, 56); float: right; font-size: 12px;\"><a href=\"http://www.vjia.com/helpcenter/Return_Policies.html#\" style=\"margin: 0px; padding: 0px; outline: none; color: rgb(51, 102, 204);\">&uarr;Top</a></span><strong>一般退换货规定</strong></p>\r\n<p style=\"margin: 0px; padding: 5px 0px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\">1、一张订单，VJIA仅为您提供一次退换货服务（特殊商品除外），如您申请换货，则只能更换同款商品，为了确保您的权益，请考虑周全后再申请办理。</p>\r\n<p style=\"margin: 0px; padding: 5px 0px 5px 24px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\">1）支持上门退换货的区域，VJIA为您提供上门服务，配送费用由VJIA承担；若您自行寄回商品，VJIA不承担邮寄费用。</p>\r\n<p style=\"margin: 0px; padding: 5px 0px 5px 24px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\">2）不支持上门退换货的区域，请您在联系客服确认后，采取邮寄退换货的方式商品寄回给我们，换货商品寄送给您的费用由VJIA承担。</p>\r\n<p style=\"margin: 0px; padding: 5px 0px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\">2、请您确保退换货时，发货单、商品吊牌、配件、说明书、赠品及各种包装完整，否则将不予办理退换货；若商品吊牌或以上包装信息不完整，在收到退货商品后VJIA将已到付的形式将原商品退还给您。</p>\r\n<p style=\"margin: 0px; padding: 5px 0px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\">3、因您个人原因造成的商品损坏脏污（如商品非正常使用及保管自行修改尺寸、洗涤、皮具打油、刺绣、长时间穿着等）将不予退换。</p>\r\n<p style=\"margin: 0px; padding: 5px 0px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\">4、礼包和套装不支持部分退换货。</p>\r\n<p style=\"margin: 0px; padding: 5px 0px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\">5、如您购买商品时VJIA 已向您提供发票，在办理退货时，请您将发票随商品一同返还给VJIA，请您妥善保管发票，如发票丢失，将无法办理退货。</p>\r\n<p style=\"margin: 0px; padding: 5px 0px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\">6、在您办理退换货后，根据您退换货的具体商品积分原则，您在VJIA的账户积分将会相应增减。</p>\r\n<p style=\"margin: 0px; padding: 5px 0px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\">7、图片及信息仅供参考，不属质量问题。因拍摄灯光及不同显示器色差等问题可能造成商品图片与实物有色差，一切以实物为准。</p>\r\n<p style=\"margin: 0px; padding: 5px 0px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\">&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 5px 0px; line-height: 21px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px;\"><strong>以上说明为VJIA商品退换货一般性规定，指定的特殊商品请根据类别查看帮助中心相应的退换货细则</strong></p>', '', '', '', '0', '1', '1242576700', '', '0', 'http://', '');
